response.about:
Предлагаю услуги по медицинскому и косметическому массажу, в профессиональном исполнении. 

Имею медицинское образование в сфере массажа, профессиональная переподготовка по программе - медицинский массаж, в т.ч. детский, стаж 7 лет. 

Владею авторской методикой моделирующего массажа "Жиротопка", по технологии Кати Дю, позволяющей убирать за 1 сеанс до 4 см в объемах тела. Доказано!

Для взрослых провожу: 

Массаж лица позволяет избежать хирургического вмешательства: 
- подтягивает кожу лица (уменьшает выраженность морщин); 
- улучшает внешний вид (эффект омоложения); 
- нормализует кровообращение; 
- расслабляет лицевые мышцы. 

Лечебный массаж помогает: 
- убирать боль в поясничном (радикулит), шейном (остеохондроз) и грудном отделах; 
- избавиться от онемения в конечностях; 
- успешно реабилитироваться после ОНМК (острого нарушения мозгового кровообращения) и травм опорно двигательного аппарата. 


Массаж классический (расслабляющий) позволяет: 
- успокоить нервную систему; 
- снять напряжение и болезненность в мышцах; 
- стимулировать гормоны, способствующие сну (при бессоннице). 

Для детей (от 1 месяца) провожу детский массаж, помогающий снять: 
- гипотонус (ослабленное состояние мышц); 
- гипертонус (напряжение мышц в состоянии покоя); 
- оказывает общеукрепляющий эффект для организма. 

Провожу в месяц пять бесплатных консультаций. 

Могу приехать на дом к клиенту со своим массажным столом и массажными средствами.
